import React from "react";


// primeste props de la parent TileList
export const Tile = ({contact}) => {
  return (
    <div className="tile-container">
        {Object.values(contact).map((value, index) => (
        <p key={index} className={`${index === 0 ? "tile-title" : ""} tile`}>
          {value}
        </p>
      ))}
    </div>
  );
};
